iCareFone is a professional photo and video organizer & file management tool (Note: It's not a WhatsApp transfer tool).

iCareFone Main Features:

- Photos Management
Easily manage photos on your device;
Use Private Photos to safeguard your privacy;

- Photos Filter
Quickly sort similar photos, blurred photos, oversized photos, and screenshots from your device;

- Files Management
iCareFone enables you to create, rename, move, and delete files/folders;
Support for sorting files by date and size;
Support for the preview of various files；
The iCareFone web version includes features for viewing file import history, searching for device files, etc.

- Files Transfer
WiFi Transfer: enables bulk file transfers between iOS devices and computers connected to the same WLAN；

- More Features
Quick access to the iCloud login directly；
